    // >>> nextSmallest((new ArrayList<Long>(Arrays.asList((long)1l, (long)1l))))
    // Optional.empty()
    public static Optional<Long> nextSmallest(ArrayList<Long> lst) {
        if (lst.size() < 2) {
            return Optional.empty();
        }
        Long first = lst.stream().min(Long::compare).get();
        lst.remove(first);
        Long second = lst.stream().min(Long::compare).orElse(null);
        return Optional.ofNullable(second);

