    // (3l)
    public static long countNums(ArrayList<Long> arr) {
        return arr.stream().filter(n -> {
            long num = n;
            if (num < 0) {
                num = -num;
            }
            long sum = 0;
            while (num > 0) {
                sum += num % 10;
                num /= 10;
            }
            return sum > 0;
        }).count();

