class Problem {
    // Everyone knows Fibonacci sequence, it was studied deeply by mathematicians in 
    // the last couple centuries. However, what people don't know is Tribonacci sequence.
    // Tribonacci sequence is defined by the recurrence:
    // tri(1) = 3
    // tri(n) = 1 + n / 2, if n is even.
    // tri(n) =  tri(n - 1) + tri(n - 2) + tri(n + 1), if n is odd.
    // For example:
    // tri(2) = 1 + (2 / 2) = 2
    // tri(4) = 3
    // tri(3) = tri(2) + tri(1) + tri(4)
    // = 2 + 3 + 3 = 8 
    // You are given a non-negative integer number n, you have to a return an array array list of the 
    // first n + 1 numbers of the Tribonacci sequence.
    // Examples:
    // >>> tri((3l))
    // (new ArrayList<Long>(Arrays.asList((long)1l, (long)3l, (long)2l, (long)8l)))
    public static ArrayList<Long> tri(long n) {
        ArrayList<Long> tribonacci = new ArrayList<Long>();
        tribonacci.add(1l);
        tribonacci.add(3l);
        if (n == 1) {
            return tribonacci;
        }
        for (long i = 2; i <= n; i++) {
            if (i % 2 == 0) {
                tribonacci.add(i / 2);
            } else {
                tribonacci.add(tribonacci.get((int)(i - 1) - 1) + tribonacci.get((int)(i - 2) - 1) + tribonacci.get((int)(i + 1) - 1));
            }
        }
        return tribonacci;

