        StringBuilder result = new StringBuilder();
        for (int i = romanNumerals.length - 1; i >= 0; i--) {
            while (number >= values[i]) {
                result.append(romanNumerals[i]);
                number -= values[i];
            }
        }
        return result.toString().toLowerCase();

