            String op_str = op.get(i);
            switch (op_str) {
                case "+":
                    stack.push(b + a);
                    break;
                case "-":
                    stack.push(b - a);
                    break;
                case "*":
                    stack.push(b * a);
                    break;
                case "//":
                    stack.push(b / a);
                    break;
